import React from 'react';
import ManagerProducts from './container/managerProducts/index';
import NotFound from './components/'

const routes = [
  {
    title: "Home",
    path: "/",
    exact: true,
    main: () => <h2>HOME</h2>,
  },
  {
    title: "Manager",
    path: "/manager",
    main: () => <ManagerProducts/>,
  },
  {
    title: "Contact",
    path: "/contact",
    main: () => <h2>CONTACT</h2>,
  },
  {
    title: "",
    path: "",
    main: () => <NotFound/>,
  },
];
export default routes;
